      autoplay: true,
      autoplaySpeed: 0,
      centerMode: true,
      centerPadding: '0',
      swipeToSlide: false,
    };

    return (
      <div className="py-4">
        <Slider {...settings}>
          {logos.map((logo, index) => (
            <div key={index} className="text-center">
              <img src={logo} alt={`Logo ${index}`} className="mx-auto w-32" />
